void UI::showGameOver() {
  gb.display.setCursor(20, 20);
  gb.display.setColor(WHITE);
  gb.display.print("GAME OVER");
  gb.display.setCursor(5, 36);
  gb.display.print("press A to restart");
}

void UI::showMainMenu() {
  if (mainMenuAnim == 48) {
    mainMenu.setFrame(0);
    if (gb.buttons.pressed(BUTTON_DOWN)) {
      mainMenuSelection++;
      if (mainMenuSelection > 2) mainMenuSelection = 0;
    } else if (gb.buttons.pressed(BUTTON_UP)) {
      mainMenuSelection--;
      if (mainMenuSelection == 255) mainMenuSelection = 2;
    }
  } else {
    mainMenuAnim--;
    if (mainMenuAnim <= 24) {
      mainMenu.setFrame(5);
    }
  }

  gb.display.drawImage(0, 0, clouds);
  gb.display.drawImage(0, 0, mainMenu);
  for (byte i = 0; i < 3; ++i) {
    if ((mainMenuSelection == i && gb.frameCount%4 == 0) || (mainMenuSelection == i && mainMenuAnim < 48)) {
      gb.display.setColor(RED);
    } else {
      gb.display.setColor(WHITE);
    }
    gb.display.setCursor(menuPositions[i][0], menuPositions[i][1]);
    gb.display.print(menuOptions[i]);
  }

  if (gb.buttons.pressed(BUTTON_A)) {
    if ((mainMenuSelection == 0 || mainMenuSelection == 1)  && mainMenuAnim == 48) {
      mainMenuAnim--;
      if (mainMenuSelection == 1) tutorial = true;
    }
  }

  if (mainMenuAnim == 0) {
    mainMenuMode = false;
  }
}

void UI::initArcade() {
  for (byte i = 0; i < skillCount; ++i) {
    skills[i].isAvailable = true;
  }
}

void UI::showArcade() {
  gb.display.setColor(RED);
  gb.display.fillRect(6, 0, 68, 64);
  gb.display.setColor(PURPLE);
  gb.display.fillRect(74, 0, 6, 64);
  gb.display.drawImage(0, 55, arcadeEdge);
  gb.display.setColor(DARKGRAY);
  gb.display.fillRect(12, 8, 56, 46);
  gb.display.drawImage(7, 56, coinUI);
  gb.display.setCursor(15, 57);
  gb.display.setColor(WHITE);
  gb.display.print(player.gold);

  for (byte i = 0; i < 3; ++i) {
    byte yPos = (skills[availableSkills[i]].id-1) * 16;
    gb.display.drawImage(14+16*i+2*i, 10, skillsGui, 0, yPos, 16, 16);
  }
  if (arcadeRow == 0) {
    if (skills[availableSkills[arcadeSkillSelection]].isAvailable) {
      gb.display.setCursor(12, 1);
      gb.display.print(skills[availableSkills[arcadeSkillSelection]].name);
      gb.display.setCursor(12, 39);
      gb.display.print(skills[availableSkills[arcadeSkillSelection]].desc);
      gb.display.setCursor(14, 29);
      gb.display.print(skills[availableSkills[arcadeSkillSelection]].cost);
    } else {
      gb.display.setCursor(12, 1);
      gb.display.print("Sold out");
    }
  } else {
    gb.display.setCursor(12, 1);
    gb.display.print("Reroll");
    gb.display.setCursor(14, 29);
    gb.display.print(shuffleCost);
  }

  gb.display.drawImage(58, 28, reroll);

  if (gb.buttons.pressed(BUTTON_B)) {
    ui.arcadeOpened = false;
  }

  if (arcadeRow == 0) {
    if (skills[availableSkills[arcadeSkillSelection]].isAvailable) {
      gb.display.setColor(YELLOW);
    } else {
      gb.display.setColor(RED);
    }
    if (gb.frameCount % 6) {
      gb.display.drawRect(13+16*arcadeSkillSelection+2*arcadeSkillSelection, 9, 18, 18);
    }
    if (gb.buttons.pressed(BUTTON_RIGHT)) {
      arcadeSkillSelection++;
      if (arcadeSkillSelection > 2) arcadeSkillSelection = 0;
    } else if (gb.buttons.pressed(BUTTON_LEFT)) {
      arcadeSkillSelection--;
      if (arcadeSkillSelection == 255) arcadeSkillSelection = 2;
    }
  } else {
    gb.display.setColor(YELLOW);
    if (gb.frameCount % 6) {
      gb.display.drawRect(57, 27, 10, 10);
    }
  }
  if (gb.buttons.pressed(BUTTON_DOWN)) {
    arcadeRow = 1;
  } else if (gb.buttons.pressed(BUTTON_UP)) {
    arcadeRow = 0;
  }
  if (gb.buttons.pressed(BUTTON_A)) {
    arcadeAction();
  }
}

void UI::shuffleSkills() {
  Utils::shuffleArray(skills, skillCount);
  byte count = 0;

  for (byte i = 0; i < skillCount; ++i) {
    if (skills[i].isAvailable) {
      availableSkills[count] = i;
      count++;
    }
    if (count > 2) break;
  }
}

void UI::drawArcade(short x, short y) {
  if (world.enemyCount > 0) arcadeMachine.setFrame(2);

  gb.display.drawImage(x, y, arcadeMachine);
}

void UI::arcadeAction() {
  if (arcadeRow == 0) {
    Skill selectedSkill = skills[availableSkills[arcadeSkillSelection]];
    if (selectedSkill.isAvailable && player.gold >= selectedSkill.cost) {
      skills[availableSkills[arcadeSkillSelection]].isAvailable = false;
      player.gold -= selectedSkill.cost;
      soundManager.playFX(PORTAL_OPENED);
      if (selectedSkill.id == 1)  {
        player.baseHp+=2;
        player.currentHp+=2;
      } else if (selectedSkill.id == 2) {
        player.longArms = true;
      } else if (selectedSkill.id == 3) {
        player.dmg++;
      } else if (selectedSkill.id == 4) {
        player.stress = true;
      } else if (selectedSkill.id == 5) {
        player.bloodlust = true;
      } else if (selectedSkill.id == 6) {
        player.godsGrace = true;
      } else if (selectedSkill.id == 7) {
        player.comboGod = true;
      }
    } else {
        soundManager.playFX(LACK_OF_GOLD);
    }
  } else if (arcadeRow == 1) {
    if (player.gold >= shuffleCost) {
      soundManager.playFX(PORTAL_OPENED);
      player.gold -= shuffleCost;
      shuffleSkills();
    }
  }
}

void UI::showTutorial() {
  if (isPause) return;

  tutorialTimer--;

  if (tutorialTimer == 0) {
    tutorialCount++;
    tutorialTimer = 100;
  }

  gb.display.setCursor(0, 40);
  gb.display.setColor(WHITE);

  switch(tutorialCount) {
    case 1:
      gb.display.print("Use cross to move\naround");
      break;
    case 2:
      gb.display.print("Attack enemies by\nrunning at them");
      break;
    case 3:
      gb.display.print("Move in time to keep turn order/combo");
      gb.display.drawImage(65, 2, arrow);
      break;
    case 4:
      gb.display.print("Use B button to\nskip turns");
      break;
    case 5:
      gb.display.print("Kill enemies to\nopen portal");
      break;
  }
}

void UI::showPauseScreen() {
  drawOverlay();
  gb.display.setColor(WHITE);
  gb.display.setCursor(30, 10);
  gb.display.print("PAUSED");
  gb.display.setCursor(2, 26);
  gb.display.print("Press A to continue");
  gb.display.setCursor(9, 42);
  gb.display.print("Press B to quit");
}

void UI::drawOverlay() {
  gb.display.setColor(BLACK);
  gb.display.fillRect(0, 0, 64, 80);
  gb.display.setColor(WHITE);
  gb.display.drawFastVLine(0, 0, gb.display.height());
  gb.display.drawFastVLine(79, 0, gb.display.height());
  gb.display.drawFastHLine(0, 0, gb.display.width());
  gb.display.drawFastHLine(0, 63, gb.display.width());
  gb.display.drawImage(3, 3, pin);
  gb.display.drawImage(3, 57, pin);
  gb.display.drawImage(74, 3, pin);
  gb.display.drawImage(74, 57, pin);
}

